import numpy as np

class CBF:
    def __init__(self, q, dq, D, C, g, alpha):
        # Joint angles
        self.q1 = q[0]
        self.q2 = q[1]
        self.q3 = q[2]
        self.q4 = q[3]
        self.q5 = q[4]
        self.q6 = q[5]
        self.q7 = q[6]

        # Joint velocities
        self.dq1 = dq[0]
        self.dq2 = dq[1]
        self.dq3 = dq[2]
        self.dq4 = dq[3]
        self.dq5 = dq[4]
        self.dq6 = dq[5]
        self.dq7 = dq[6]

        self.q = [self.q1, self.q2, self.q3, self.q4, self.q5, self.q6, self.q7]
        self.dq = [self.dq1, self.dq2, self.dq3, self.dq4, self.dq5, self.dq6, self.dq7]

        self.D = D
        self.C = C
        self.g = g

        # CBF parameters
        self.alpha = alpha

    def f_x(self):
        try:
            fx_1 = np.array(self.dq).T.reshape(7,1)
            fx_2 = np.array((-np.linalg.inv(self.D) @ (self.C + self.g))).reshape(7,1)
            fx = np.vstack((fx_1, fx_2))        
        
        except np.linalg.LinAlgError:
            reg = 1e-8  
            D_reg = self.D + reg * np.eye(self.D.shape[0])

            fx_1 = np.array(self.dq).T.reshape(7,1)
            fx_2 = np.array((-np.linalg.inv(D_reg) @ (self.C + self.g))).reshape(7,1)
            fx = np.vstack((fx_1, fx_2))

        return fx

    def g_x(self):
        try:
            gx = np.vstack((np.zeros((7, 7)), np.linalg.inv(self.D)))
        except np.linalg.LinAlgError:
            reg = 1e-8 
            D_reg = self.D + reg * np.eye(self.D.shape[0])
            gx = np.vstack((np.zeros((7, 7)), np.linalg.inv(D_reg)))
        return gx
    
